  10,\n\t\"tags\": [],\n\t\"title\": \"Coral reef fish reproduction, species, fish
  length and weight, and others within New Ireland Province, Papua New Guinea from
  2015-03-12 to 2015-03-23 (NCEI Accession 0144344)\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  4,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-04-26T00:55:19.613582\",\n\t\"name\": \"coral-reef-fish-reproduction-species-fish-length-and-weight-and-others-within-new-ireland-provi\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Natural-resource professionals performed
  novel research on the reproductivenbiology of exploited reef fishes. Each participant
  produced reproductivendata for a single target species, yielding new information
  for four species.nThese data can be used to describe: length-weight relationships
  (includingnsex-based differences), size-at-maturity for each sex (minimum size-at-maturity,nand
  size-at-50%-maturity), reproductive mode (total vs batch spawning,ngonochorism vs
  hermaphroditism), sex ratios (overall and size-specific),nlength-fecundity relationships,
  and reproductive periodicity (lunar, seasonal).nnThe fish were taken in the coral
  reef ecosystem for the area west andnsouth of Kavieng, New Ireland Province, Papua
  New Guinea in March 2015.nSpecific site location of each catch was not given. About
  90% ofnthe catch was near Mait Island.\",\n\t\"license_title\": null,\n\t\"extras\":
